
global
  maxconn 1000
  stats socket /tmp/haproxy.sock mode 600 level admin expose-fd listeners
  stats timeout 2m

defaults
  timeout connect 5s
  timeout client 30s
  timeout client-fin 1s
  timeout server 300s
  timeout server-fin 1s
  timeout http-request 10s
  timeout http-keep-alive 300s
  timeout tunnel 1h
  option logasap


listen stats
  bind :1936
  log global
  option httplog
  mode http
  stats enable
  stats refresh 1s
  stats uri /stats


frontend alive-1
  bind unix@/var/lib/haproxy/run/alive-1.sock


